import React from 'react';
import Person from './Person';
import {people} from './People'

const list = people.map(i=>{
    return i;
})

const Personlist = ()=>{
    return (
         
        <div>
           
               
               name={people[1].name} 
                email={people[1].email}
                    treet1={people[1].address.street}
                    street2={people[1].address.suite}
                    street3={people[1].address.city}
                />
            <Person 
               
               name={people[2].name} 
                email={people[2].email}
                    treet1={people[2].address.street}
                    street2={people[2].address.suite}
                    street3={people[2].address.city}
                />
        </div>
    )
}

export default Personlist
